    const [nodes, setNodes] = useState([[]]);

    useEffect(() => {
        for( let row = 0; row < 15; row++) {
            const currentRow = [];
            for( let col = 0; col < 50; col++) {
                currentRow.push([]);
            }
            nodes.push(currentRow);
        }
        setNodes(nodes);
    });

